import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import {Navigation,Footer,Home,About,Contact} from "./components";

function App() {
  return (
    <div className="App">
      <Router>
        <Navigation/>
        <Switch>
          <Route path="/" exact com Home/>
        </Switch>
        <Footer/>
      </Router>
    </div>
  );
}

export default App;
